import React from 'react'
import axios from "axios";
import './Search.css'


class Search extends React.Component{


    constructor() {
        super();

        this.state = {
          dt: [],
          value: 0
        };
      }

      call = () => {
        var b = [];
        var self = this;
        axios
          .get("http://localhost:5000/data")
          .then((response) => {
            // handle success
            var a = JSON.stringify(response);
            a.toLowerCase()
             console.log(a)

            var separators = [
              " ",
              "\\\\n",
              "\\.",
              '\\\\',
              '\\\/',
              '\\\'',
              ",",
             '\\-',
             '\\_',

              "\\*",
              '\\\(', 
              '\\\)',
              "/",
              "[",
              "]",
              ":",
              '\\"',
              "}",
              "{",
              "@",
              "\\?",
              "\\;",
              '[0-9]',
              '>',
              '<'
            ];
            console.log(separators.join("|"));
             b = a.split(new RegExp(separators.join("|"), "g"));

            console.log(b);
            self.setState({ dt: b });
            console.log(self.state.dt);

            var ob= new Object()

            for(var i=0;i<b.length;i++){

              if(!(b[i] in ob && b[i]!=="")){
                ob[b[i]]=1
              }
              else{
                ob[b[i]]=ob[b[i]]+1
              }

            }

            console.log(ob)
          })
          .catch(function (error) {
            // handle error
            console.log(error);
          })
          .finally(function () {
            // always executed
          });
      };

      inputHandler=(e)=>{

          this.setState({
            value:e.target.value
          })


          console.log(this.state.value)
      }

    render(){


        return (

            <div className="bd">
                <center>

                <div>
                <input className="searchbar" type="text"  placeholder="Enter the number..... " onChange={this.inputHandler} />

                <button className="bts" onClick={() => this.call()}>submit</button>
                </div>

                </center>




            </div>
        )
    }
}


export default Search
